import React from 'react';

function CardInfo(props){


    return(
        <div className={"cardInfo"}>
            <h1>{props.crd.name}</h1>
            {props.crd.subtypes!==null && props.crd.subtypes.map((sb, idx)=>
                <h2 key={idx}>{sb.name} </h2>
            )}
            <h3>{props.crd.type_name}</h3>
        </div>
    )
}

export default CardInfo
